import React, { useCallback, useEffect, useState } from "react";
import styled from "styled-components";
import Textarea from "../commons/TextArea";
import ButtonGroup from "@material-ui/core/ButtonGroup";
import Button from "@material-ui/core/Button";
import Calender from "../commons/Calender";
import { Link, useHistory } from "react-router-dom";
import DefaultButton from "../commons/button/DefaultButton";
import PrimaryButton from "../commons/button/PrimaryButton";
import MainTemplate from "../templete/Maintemplete";

const Page1: React.FC = (props) => {
  return (
    <MainTemplate title="top">
      <SerchLine>
        <Text>なまえ</Text>
        <CalenderArea>
          <Calender dataType={dataType} />
        </CalenderArea>
        <Text>さんか</Text>
        <CalenderArea>
          <Calender dataType={dataType} />
        </CalenderArea>
        <Text>かみなり</Text>
        <Textarea
          width="160px"
          state={{ text: policyVinNo, setText: setPolicyVinNo }}
          margin="4px"
        />
        {/* <SearchButton onClick={search}>検索</SearchButton> */}
        <ButtonGroup color="primary" aria-label="outlined primary button group">
          {/* <CrearButton
            color="primary"
            // disabled={true}
            aria-label="outlined primary button group"
            onClick={clear}
          >
            削除
          </CrearButton> */}
        </ButtonGroup>
      </SerchLine>
      <Text>A:{countA}</Text>
      <Text>B:{countB}</Text>
      <ButtonGroup>
        <Button
          onClick={() => {
            setCountA(countA + 1);
          }}
        >
          count A
        </Button>
        <Button
          onClick={() => {
            setCountB(countB + 1);
          }}
        >
          count B
        </Button>
        <PrimaryButton text="いんどう" url="/page2" />
        <Link to="/page3">いいページ</Link>;
      </ButtonGroup>
    </MainTemplate>
  );
};

const CountButton = styled(Button)`
  color: red;
  background-color: blue;
`;

const CalenderArea = styled.div`
  input {
    width: 130px;
    height: 50px;
    boder: gray 1px solid;
  }
`;

const SerchLine = styled.div`
  display: flex;
`;
const Text = styled.div`
  color: blue;
  font-size: 40px;
`;
const SampleStyle = styled.div`
  background: red;
  height: 200px;
`;

export type Type = {
  value: string;
  width: string;
  text: string;
};

export default Page1;
